"lang":"nl",
"name":"TR063: Indien StatusAanlevering de waarde 3 (aanlevering verwijderen) bevat, dan moet voor de betreffende Client een eerdere aanlevering met dezelfde sleutel verstuurd zijn.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Gezien het corrigerende karakter van een aanlevering met StatusAanlevering 3, is het niet nodig om hierop overige inhoudelijke controles uit te voeren.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Opmerking:&nbsp;<p style=\"margin-top: 3pt;\">Deze regel is bedoeld om het gebruik van de waarde 3 in goede banen te leiden en zegt niets over het mogelijk toegestaan zijn van deze waarde. Eventuele beperkingen van dit gebruik worden via een constraint (of eventueel andere technische regels) beschreven.</span><span style=\" font-size: 10pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"documentation","title":"Rationale","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Met status aanlevering 3 wordt aangegeven dat de eerder verzonden berichtklasse verkeerde informatie bevatte en daarom verwijderd moet worden. De sleutelvelden van de te verwijderen berichtklasse moeten overeenkomen met de eerder verzonden berichtklasse om te kunnen bepalen welke berichtklasse verwijderd moet worden.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CA317","id":27946,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"CA319","id":29113,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_RetourCode-Wlz","id":30317,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW35","id":30565,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK35","id":30585,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR063","niveau":"berichtoverstijgend"}}}]
