"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Wanneer de Geboortedatum niet volledig of onbekend is, dan wordt het deel dat wel bekend is gebruikt en wordt voor de overige delen de waarde 01 (dag en maand) of 1900 (jaar) gebruikt. Het element DatumGebruik geeft aan welk deel van de datum bekend is en dus te gebruiken. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voorbeelden: &nbsp;<p style=\"margin-top: 3pt;\">* Een volledig onbekende geboortedatum wordt 01-01-1900 &nbsp;<p style=\"margin-top: 3pt;\">* Is alleen bekend dat de geboorte in 1953 was, dan wordt de geboortedatum 01-01-1953 &nbsp;<p style=\"margin-top: 3pt;\">* Is alleen bekend dat de geboorte in september 1949 was, dan wordt de geboortedatum 01-09-1949&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CDT_Geboortedatum","id":30630,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV009"}}}]
