,
"40394" : {
"id":40394,
"typeIconPath":"data/icons/ArchiMate/AbstractFolder.png",
"data" : [
{
"lang":"nl",
"name":"Map",
"type":"Map",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een constraint is een beperking van de toegestane waarden van een (bericht)element. Een constraint is altijd te controleren binnen het bericht en is daarmee niet berichtoverstijgend.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Een constraint is van toepassing op een (bericht)element of datatype.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
,
"40395" : {
"id":40395,
"typeIconPath":"data/icons/ArchiMate/AbstractFolder.png",
"data" : [
{
"lang":"nl",
"name":"Map",
"type":"Map",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een technische regel is een vertaling van een bedrijfsregel in termen van een bepaalde berichtklasse en een element dat daarmee technisch te valideren is. Deze regels kunnen berichtklasse- of berichtoverstijgend zijn.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Een technische regel is een uitwerking van een bedrijfsregel.&nbsp;<p style=\"margin-top: 3pt;\">* Een technische regel is van toepassing op een berichtelement of berichtklasse.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
,
"40396" : {
"id":40396,
"typeIconPath":"data/icons/ArchiMate/AbstractFolder.png",
"data" : [
{
"lang":"nl",
"name":"Map",
"type":"Map",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een conditie is een technisch te controleren voorwaarde waaronder een (bericht)element gevuld moet of mag worden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Een conditie is van toepassing op een (bericht)element.<span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
,
